const getSVGByName = (
  name: TProductType | "recipes" | "blog" | "about" | "greens",
  style?: string
) => {
  const className = style ? style : " aspect-square ";
  switch (name) {
    case "vegetable":
      return <VegetablesSvg className={className} />;
    case "fruit":
      return <FruitSvg className={className} />;
    case "mushrooms":
      return <FungiSvg className={className} />;
    case "root":
      return <RootsSvg className={className} />;
    case "herb":
      return <HerbsSvg className={className} />;
    case "sea vegetables":
      return <AlgaeSvg className={className} />;
    case "legume":
      return <LegumeSvg className={className} />;
    case "nut":
      return <NutsSvg className={className} />;
    case "spice":
      return <SpicesSvg className={className} />;
    case "grocery":
      return <GrocerySvg className={className} />;
    case "recipes":
      return <RecipesSvg className={className} />;
    case "dairy":
      return <DairySvg className={className} />;
    case "blog":
      return <BlogSvg className={className} />;
    case "about":
      return <AboutSvg className={className} />;
    case "greens":
      return <GreensSvg className={className} />;
    default:
      return <MiscellaneousSvg className={className} />;
  }
};

